import React from "react";
import HeaderElement from "./HeaderElement";
import '../styles/headers/Header.css';

const header_elements = [
    {
        id:1,
        name:"Календарь"
    },
    {
        id:2,
        name:"Профиль"
    }
]

const Header = () => {
    return (
        <div>
            {header_elements.map(header_element => (
                <HeaderElement key={header_element.id} name={header_element.name}></HeaderElement>
            ))}
        </div>
    )
}

export default Header;
